description:
Verenigde Staten
Komedie / Romantiek
108 minuten

goed

met Owen Wilson, Matt Dillon en Kate Hudson

Carl en Molly Peterson zijn een pas getrouwd stelletje met een nieuw leven, nieuw huisje en pril geluk. Wanneer echter Carl's 
beste vriend Randy Dupree ontslagen wordt en in de goot belandt, nodigt Carl hem uit een tijdje bij hen te komen wonen. Dupree 
heeft het echter iets te goed naar zijn zin en Carl heeft het al moeilijk genoeg om de verantwoordelijke echtgenoot uit te 
hangen. Dan blijkt Dupree ook nog eens veel te goede maatjes te worden met Molly en haar vader..
